import { StyleSheet, Text, View } from "react-native";
import React from "react";

const Splash = ({ navigation }) => {
  setTimeout(() => {
    navigation.replace("Onboarding");
  }, 1500);

  return (
    <View>
      <Text>splash</Text>
    </View>
  );
};

export default Splash;

const styles = StyleSheet.create({});
